script: |
  super -f text -I q10312.spq | sort > q10312.out

inputs:
  - name: q10312.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE col1 * col1 * + col1 BETWEEN + 27 AND - col2 * - col0 + - - ( + - col0 ) * - + col1 + - col1 - + col0;
  - name: tab1

outputs:
  - name: q10312.out
    data: |
      51	14	96
      85	5	59
